import React, { Component } from 'react';
import './NavBar.css';

class NavBar extends Component {
 render() {
 return (
    <div className="NavBar">
      <header className="NavBar-header">
        <p>
         Questa e la mia navbar!
        </p>
      </header>
    </div>
  );

}

}

export default NavBar;
